/*!50003 CREATE DEFINER=`game`@`%` PROCEDURE `csp_deposit`(varbillingId INT,varloginName VARCHAR(16),varamount INT,vardepositType CHAR(2),OUT intResult INT)
BEGIN
 DECLARE result_success INT;
 DECLARE result_error INT;
 DECLARE record_nums INT;
 DECLARE balance_before INT;
 DECLARE balance_after INT;
 DECLARE amount_notsend INT;
 DECLARE temp_deposit_status CHAR(2);
 DECLARE deposit_status_success  CHAR(2);
 DECLARE deposit_status_error  CHAR(2);
 DECLARE deposit_status_default  CHAR(2);
 DECLARE temp_user VARCHAR(16);
 DECLARE temp_money INT;
 DECLARE temp_hm INT;
 DECLARE tn INT;
 DECLARE loops INT;
 DECLARE i INT;
 DECLARE n INT;
 SET temp_deposit_status='01';
 SET deposit_status_success='01';
 SET deposit_status_error='02';
 SET deposit_status_default='03';
 SET result_success=0;
 SET result_error=-1;
 SET record_nums=0;
 SET intResult=result_success;
 SET temp_user=varloginName;
 SET temp_money=0;
 SET temp_hm=0; 
 
 IF NOT EXISTS (SELECT 1 FROM account WHERE account=temp_user) THEN
INSERT INTO account(account,psw,gmlevel,adult,purse,TIME) VALUES(temp_user,'',0,0,0,0);
 END IF;
 IF EXISTS (SELECT 1 FROM deposit_log WHERE billingId=varbillingId) THEN
 SELECT depositstatus,amount
 INTO  temp_deposit_status,amount_notsend
 FROM deposit_log
 WHERE billingId=varbillingId;
 IF temp_deposit_status<>deposit_status_success THEN             
 UPDATE account
 SET purse=purse+amount_notsend
 WHERE account=temp_user;
 SELECT purse,purse-varamount INTO balance_after,balance_before
 FROM account WHERE account=temp_user;
 UPDATE deposit_log
 SET balanceBefore=balance_before,
 balanceafter=balance_after,
 updatetime=CURRENT_TIMESTAMP(),
 depositstatus=deposit_status_success
 WHERE billingId=varbillingId;
 END IF;
 ELSE
IF varamount>=200 AND NOW()>DATE_FORMAT("2011-04-11 00:00:01",'%Y-%m-%d %H:%i:%s')
	 AND NOW()<DATE_FORMAT("2011-04-15",'%Y-%m-%d') THEN
	 
	CASE WHEN varamount>=1000 THEN
		
	SELECT COUNT(1) INTO temp_hm
	 FROM deposit_log WHERE  SUBSTR(updatetime,1,10) =CURRENT_DATE() AND loginname= varloginName
	 AND amount>=1000;
	 
	 IF temp_hm<5 THEN	   
		INSERT INTO gift(account,gift,TIME)
