	 END IF; 
		
		
	WHEN varamount>=500 THEN
		
	SELECT COUNT(1) INTO temp_hm
	 FROM deposit_log WHERE  SUBSTR(updatetime,1,10) =CURRENT_DATE() AND loginname= varloginName
	 AND amount>=500 AND amount<1000;
	 
	 IF temp_hm<50 THEN	   
		INSERT INTO gift(account,gift,TIME)
		VALUES(varloginName,'5%i152028#1#1%³äÖµ»î¶¯Àñ°ü%¹§Ï²Äú»ñµÃ³äÖµ»î¶¯½±Àø£¡',UNIX_TIMESTAMP());
	    
	 END IF; 		
		
	ELSE 
		SELECT COUNT(1) INTO temp_hm
	 FROM deposit_log WHERE  SUBSTR(updatetime,1,10) =CURRENT_DATE() AND loginname= varloginName
	 AND amount>=200 AND amount<500;
	 
	 IF temp_hm<50 THEN	   
		INSERT INTO gift(account,gift,TIME)
		VALUES(varloginName,'5%i160103#1#1%³äÖµ»î¶¯Àñ°ü%¹§Ï²Äú»ñµÃ³äÖµ»î¶¯½±Àø£¡',UNIX_TIMESTAMP());
	    
	 END IF; 
	END CASE;
 END IF; 
 
